package com.alex.blog.model;import com.alex.blog.base.BaseModel;import java.util.Date;/** * 文章收藏表 Model * * @author alex * @date 2019-09-09 22:24:02 */public class BlogArticleCollect extends BaseModel {		/** 	* 自增id	*/	private Integer id;	/** 	* 文章id	*/	private Integer articleId;	/** 	* 用户id	*/	private Integer userId;	/** 	* 创建时间	*/	private Date createTime;		public Integer getId() {	    return this.id;	}	public void setId(Integer id) {	    this.id=id;	}	public Integer getArticleId() {	    return this.articleId;	}	public void setArticleId(Integer articleId) {	    this.articleId=articleId;	}	public Integer getUserId() {	    return this.userId;	}	public void setUserId(Integer userId) {	    this.userId=userId;	}	public Date getCreateTime() {	    return this.createTime;	}	public void setCreateTime(Date createTime) {	    this.createTime=createTime;	}}